import React from "react";
import Login from "./components/login";
import Register from "./components/register";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

const Navbar = () => {
  return (
    <nav className="navbar navbar-expand-lg" style={{ backgroundColor: "#000" }}>
      <div className="container">
        <Link className="navbar-brand text-white" to="/">HCMUS-STONER</Link>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav me-auto">
            <li className="nav-item"><Link className="nav-link text-white" to="/">Home</Link></li>
            <li className="nav-item"><Link className="nav-link text-white" to="/about">About</Link></li>
            <li className="nav-item"><Link className="nav-link text-white" to="/how-to-use">How to use</Link></li>
          </ul>
          <Link to="/login" className="btn btn-sm btn-light me-2">Login</Link>
          <Link to="/register" className="btn btn-sm btn-light">Register</Link>
        </div>
      </div>
    </nav>
  );
};

const Home = () => (
  <div className="container text-center mt-5">
    <h1>Welcome to my website</h1>
    <p>Viết nội dung sau...</p>
  </div>
);

const About = () => <div className="container text-center mt-5"><h1>About Page</h1></div>;
const HowToUse = () => <div className="container text-center mt-5"><h1>How to Use Page</h1></div>;

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/how-to-use" element={<HowToUse />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
      </Routes>
    </Router>
  );
};

export default App;
